import React from "react";


const Footer = () => {
    return ( 
        <>
        <div className="w-full h-[10vh] py-[100px]">
            <footer className="bg-[#71AC57] p-[250px] z-10">
                <div className=" flex justify-center text-center items-center ">
                    <p className=" text-white"> Write to us <span>nasz e-mail</span></p>
                    <img className="bg-cover p-[20px] w-[70px] h-[70px] pt-5" src="./github.png" alt="" />
                </div>
            </footer>
        </div>
        </>
     );
}
 
export default Footer;
